import React, { Component } from 'react';
import { Table } from 'reactstrap';



const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>

    );
}
const TableBody = props => {
    const rows = props.charactersData.map((row, index) => {
        return (
            <tr keys={index}>
                <td>{row.id}</td>
                <td>{row.name}</td>
                <td>{row.job}</td>
            </tr>
        );
    });
    return (
        <tbody>{rows}</tbody>
    )
}

class Table1 extends Component {
    render() {
        // const name = this.props.characterData;
        return (
            <Table>
                <TableHeader />
                <TableBody charactersData={this.props.characterData} removecharacter={this.props.removeCharacter} />

            </Table>
        );
    }
}

export default Table1;
